const ExpenseDate = (pros) => {
  const ddate = pros.toLocaleString("default", { month: "long" });
  const day = pros.toLocaleString("default", { day: "2-digit" });
  const year = pros.getFullYear();
  return (
    <div>
      <div>{ddate}</div>
      <div>{year}</div>
      <div>{day}</div>
    </div>
  );
};

export default ExpenseDate
